import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import LoadingSpinner from '../../shared/loading_spinner';
import '../../../scss/individual_page/individual_page_game_info.scss';

export default function GameInfoPage(props) {
  if (!props.game) {
    return <LoadingSpinner />;
  }

  console.log(props.game.platforms.platform.name);
  const platformList = () => {if(props.game) {
    props.game.platforms.forEach((platform) => console.log(platform));
  }
}
  console.log('list', platformList);

  return (
    <Container className="pt-5" id="game-info-container">
      <Row>
        <Col lg={2} className="about-game">
          About Game
        </Col>
        <Col lg={{ span: 9, offset: 1 }}>
          <Row className="pb-3">
            <Col>
              <h5>Developer</h5>
              <p>
                {props.game !== undefined
                  ? props.game.developers[0].name
                  : ''}
              </p>
            </Col>
            <Col>
              <h5>Publisher</h5>
              <p>
                {props.game !== undefined
                  ? props.game.publishers[0].name
                  : ''}
              </p>
            </Col>
            <Col>
              <h5>Available</h5>
              <p>
                {props.game !== undefined
                  ? props.game.released
                  : ''}
              </p>
            </Col>
          </Row>
          <Row>
            <Col>
              <h5>Metacritic</h5>
              <p>
                {props.game !== undefined
                  ? props.game.metacritic
                  : ''}
              </p>
            </Col>
            <Col>
              <h5>Rating</h5>
              <p>
                {props.game !== undefined
                  ? props.game.rating
                  : ''}
              </p>
            </Col>
            <Col>
              <h5>Platform</h5>
            </Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
}
